import React from 'react';

export default function Likes(props) {
  return (
    <div>
      <div>
        <img src={`/img/${props.likes}.png`} />
      </div>

      <div>
        <img src={`/img/${props.comments}.png`} /> {/* usar title*/}
      </div>
    </div>
  );
}
